    "import pandas as pd\n",
    "import numpy as np\n",
    "import datetime\n",
    "import seaborn as sns\n",
    "import matplotlib.pyplot as plt\n",
    "from sklearn.compose import ColumnTransformer\n",
    "from sklearn.pipeline import Pipeline\n",
    "from sklearn.preprocessing import OneHotEncoder, MinMaxScaler\n",
    "from sklearn.impute import SimpleImputer\n",
    "from sklearn.model_selection import train_test_split, GridSearchCV\n",
    "from sklearn.metrics import classification_report\n",
    "from joblib import dump, load\n",
    "from sklearn.base import BaseEstimator, TransformerMixin\n",
    "from sklearn.ensemble import RandomForestClassifier\n",
    "\n",
    "sns.set_theme(style=\"ticks\", palette=\"pastel\")\n",
    "\n",
    "def remove_outliers(df, col: str):\n",
    "    q3 = np.quantile(df[col], 0.75)\n",
    "    q1 = np.quantile(df[col], 0.25)\n",
    "    l_lmt = q1 - 1.5 * (q3 - q1)\n",
    "    u_lmt = q3 + 1.5 * (q3 - q1)\n",
    "    return df[(df[col] >= l_lmt) & (df[col] <= u_lmt)].copy()\n",
    "    \n",
    "#Read Sample Dataset\n",
    "raw_df = pd.read_csv('C:/Users/lenovo/Desktop/Intern实习/Data Science Solutions Implementation/Day 2/dssi-streamlit-main/data/loan_dataset.csv')\n",
    "raw_df.head()"
